        let newArr = []
        for (i = 0; i < med.length -1; i++) {
            newArr.push(med.rxcui+"+")
        }
        return newArr
    }))

    console.log("selectedMeds map: ", selectedMeds.map(drug => drug.rxcui+"+"))
    console.log(rxcuiCollection)
    return (


        <div>
           <SelectedMedsList />
           <div>
                {selectedMeds.forEach(med => rxcuiCollection.push(med.rxcui + "+"))}
           </div>
        </div>
    )
}
